import React, {Component} from 'react';

import './Welcome.css';
import play from '/../components/player/play.json';

class Welcome extends Component {
  render () {
    const elem = play.assets;
    return (
     <ul>
       {Object.keys(elem).map((v, i) => <li key={i}>{v} {play[v]}</li> )}
     </ul>
    )
  }
};

export default Welcome;
